body.script:
function share() {
	const shareData = {
		title: 'A vivir que son dos días - Podcast Details',
		text: 'All the public stats of the podcast A vivir que son dos días',
		url: 'https://podcastdetails.com/?url=https://fapi-top.prisasd.com/podcast/playser/a_vivir_que_son_dos_dias/itunestfp/podcast.xml',
	}
	// if(typeof screen.orientation === 'undefined' && window.navigator && window.navigator.share) {
	// 	navigator.share(shareData);
	// 	return;
	// }
	if (window.navigator && window.navigator.share && window.navigator.canShare(shareData) && window.navigator.canShare(shareData) && typeof screen.orientation === 'undefined') {
		navigator.share(shareData);
	} else {
		window.location.href = 'https://wocial.com/?create=1&url='+encodeURIComponent('https://podcastdetails.com/?url=https://fapi-top.prisasd.com/podcast/playser/a_vivir_que_son_dos_dias/itunestfp/podcast.xml')+'&text='+encodeURIComponent('A vivir que son dos días - Podcast Details')+'';
	}
}
